import {BrowserRouter,Routes,Route} from "react-router-dom";
import './App.css';
import Navbar from "./components/Layout";
import Home from "./components/Home";
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Navbar/>}>
      <Route index element={<Home/>}></Route>

      </Route>

    </Routes>

    </BrowserRouter>
    </>
  );
}


export default App;
